window.bookSummaryJSON = "<p>The Collapse changed everything. Good men became killers. Strong women became property. And I’ve been captured by the most ruthless men of them all....</p> <p>I’m a healer trying to survive in a violent, lawless land. Being captured by the infamous Steel Demons MC was never part of the plan. The MC president wants me to be the club’s new medic and also in his bed.</p> <p>Reaper might be built for pleasure, but I mean nothing to him. He makes that clear when he suggests sharing me with his best friend. Jandro is the club's VP, and his flirting makes it clear it’s all a game to them. They claim me now, but what happens when they get bored?</p> <p>I’m caught between the fast, violent lifestyle of these men and growing feelings I can’t ignore. With a war on the horizon, being the chosen woman of a band of ruthless bikers doesn’t seem so bad. Especially not when they’ll do anything to protect me.</p> <p>I need to find my place within this club that sees women as property, or escape and face the oncoming storm alone. It’s an impossible decision when I realize I’m falling in love with two men.</p> <p>But when I start falling for a third? I’ll never be free again.</p> <p><i>Sons of Anarchy</i> meets <i>The Handmaid's Tale</i> in this spicy, fast-paced adventure! This omnibus volume contains the first three books in the series: <i>Lawless</i>, <i>Powerless</i>, and <i>Fearless</i>.</p>"; 
